import React from "react";
import styled from "styled-components";
import { Contentdiv, TitleDiv, Row, Col, TextBox } from "./styles/commonstyle";

const Contact = () => {
  return (
    <React.Fragment>
      <Contentdiv>
        <TitleDiv>Contact</TitleDiv>

        <Row>
          <Col>
            <TextBox>
            <ul class="list-group list-group-flush">
  <li class="list-group-item">
    <a href="@Timothe_Renaud"> @Timothe_Renaud </a> on Twitter
</li>
  <li class="list-group-item"><a href="https://www.pearltrees.com/"> Veuille Technologie  </a></li>
  <li class="list-group-item">Morbi leo risus</li>
  <li class="list-group-item">Porta ac consectetur ac</li>
  <li class="list-group-item">Vestibulum at eros</li>
</ul>

            </TextBox>
          </Col>
        </Row>

      </Contentdiv>
    </React.Fragment>
  );
};

export default Contact;
